import React, { useState, useEffect } from 'react';
import './EditUser.css';

function EditUser({ onBackClick, currentUser }) {
  const [selectedSports, setSelectedSports] = useState([]);
  const [preferenceMode, setPreferenceMode] = useState('simple');
  const [intensityLevel, setIntensityLevel] = useState(2);
  const [isLoading, setIsLoading] = useState(false);
  const [saveMessage, setSaveMessage] = useState('');
  const [isSaving, setIsSaving] = useState(false);

  const SPORTS_LIST = [
    { id: 1, name: '◊õ◊ì◊ï◊®◊í◊ú', icon: '‚öΩ' },
    { id: 2, name: '◊õ◊ì◊ï◊®◊°◊ú', icon: 'üèÄ' },
    { id: 3, name: '◊ò◊ô◊§◊ï◊°', icon: 'üßó' },
    { id: 4, name: '◊ó◊ì◊® ◊õ◊ï◊©◊®', icon: 'üèãÔ∏è' },
    { id: 5, name: '◊ß◊ï◊®◊ì◊ô◊†◊¶◊ô◊î', icon: 'üéØ' },
    { id: 6, name: '◊ò◊†◊ô◊°', icon: 'üéæ' },
    { id: 7, name: '◊§◊ô◊†◊í◊§◊ï◊†◊í', icon: 'üèì' },
    { id: 8, name: '◊®◊ô◊ß◊ï◊ì', icon: 'üíÉ' },
    { id: 9, name: '◊ê◊ï◊§◊†◊ô◊ô◊ù', icon: 'üö¥' }
  ];

  const loadUserPreferences = async () => {
    if (!currentUser || !currentUser.id) {
      console.log('◊ê◊ô◊ü ◊û◊©◊™◊û◊© ◊†◊ï◊õ◊ó◊ô');
      return;
    }

    console.log('◊ò◊ï◊¢◊ü ◊î◊¢◊ì◊§◊ï◊™ ◊¢◊ë◊ï◊® ◊û◊©◊™◊û◊©:', currentUser.id);
    setIsLoading(true);

    try {
      const response = await fetch(`https://wolfit-gym-backend-ijvq.onrender.com/api/user-preferences/${currentUser.id}`);
      console.log('◊™◊í◊ï◊ë◊î ◊û◊î◊©◊®◊™:', response.status);

      if (response.ok) {
        const result = await response.json();
        console.log('◊†◊™◊ï◊†◊ô◊ù ◊©◊î◊™◊ß◊ë◊ú◊ï:', result);

        if (result.success && result.data) {
          const { intensityLevel, selectedSports, preferenceMode } = result.data;

          console.log('◊®◊û◊™ ◊¢◊¶◊ô◊û◊ï◊™:', intensityLevel);
          console.log('◊°◊§◊ï◊®◊ò ◊†◊ë◊ó◊®◊ô◊ù:', selectedSports);
          console.log('◊û◊¶◊ë ◊î◊¢◊ì◊§◊î:', preferenceMode);

          setIntensityLevel(intensityLevel || 2);
          setSelectedSports(selectedSports || []);
          setPreferenceMode(preferenceMode || 'simple');

          console.log('State ◊¢◊ï◊ì◊õ◊ü ◊ë◊î◊¶◊ú◊ó◊î');
        } else {
          console.log('◊ê◊ô◊ü ◊î◊¢◊ì◊§◊ï◊™ ◊ß◊ô◊ô◊û◊ï◊™ ◊ê◊ï ◊™◊í◊ï◊ë◊î ◊ú◊ê ◊™◊ß◊ô◊†◊î');
          setSelectedSports([]);
          setPreferenceMode('simple');
          setIntensityLevel(2);
        }
      } else {
        console.log('◊©◊í◊ô◊ê◊î ◊ë◊™◊í◊ï◊ë◊î ◊û◊î◊©◊®◊™:', response.status);
        setSelectedSports([]);
        setPreferenceMode('simple');
        setIntensityLevel(2);
      }
    } catch (error) {
      console.error('◊©◊í◊ô◊ê◊î ◊ë◊ò◊¢◊ô◊†◊™ ◊î◊¢◊ì◊§◊ï◊™:', error);
      setSelectedSports([]);
      setPreferenceMode('simple');
      setIntensityLevel(2);
    } finally {
      setIsLoading(false);
    }
  };

  const saveUserPreferences = async () => {
    console.log('=== ◊î◊™◊ó◊ú◊™ ◊©◊û◊ô◊®◊™ ◊î◊¢◊ì◊§◊ï◊™ ===');

    if (!currentUser || !currentUser.id) {
      console.log('‚ùå ◊ê◊ô◊ü ◊û◊©◊™◊û◊© ◊†◊ï◊õ◊ó◊ô ◊ú◊©◊û◊ô◊®◊î');
      return;
    }

    if (selectedSports.length === 0) {
      console.log('‚ùå ◊ê◊ô◊ü ◊°◊§◊ï◊®◊ò ◊†◊ë◊ó◊®◊ô◊ù');
      setSaveMessage('◊ê◊†◊ê ◊ë◊ó◊® ◊ú◊§◊ó◊ï◊™ ◊°◊§◊ï◊®◊ò ◊ê◊ó◊ì');
      return;
    }

    console.log('‚úÖ ◊û◊©◊™◊û◊©:', currentUser.id);
    console.log('‚úÖ ◊°◊§◊ï◊®◊ò ◊†◊ë◊ó◊®◊ô◊ù:', selectedSports);
    console.log('‚úÖ ◊û◊¶◊ë ◊ì◊ô◊®◊ï◊í:', preferenceMode);
    console.log('‚úÖ ◊®◊û◊™ ◊¢◊¶◊ô◊û◊ï◊™:', intensityLevel);

    setIsSaving(true);
    setSaveMessage('');

    try {
      const requestData = {
        intensityLevel: intensityLevel,
        selectedSports: selectedSports
      };

      console.log('üì§ ◊†◊™◊ï◊†◊ô◊ù ◊ú◊©◊ú◊ô◊ó◊î:', JSON.stringify(requestData, null, 2));

      const url = `https://wolfit-gym-backend-ijvq.onrender.com/api/save-user-preferences/${currentUser.id}`;
      console.log('üåê URL:', url);

      const response = await fetch(url, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(requestData)
      });

      console.log('üì• ◊™◊í◊ï◊ë◊™ ◊©◊û◊ô◊®◊î:', response.status, response.statusText);

      if (response.ok) {
        const result = await response.json();
        console.log('‚úÖ ◊™◊ï◊¶◊ê◊™ ◊©◊û◊ô◊®◊î:', result);
        setSaveMessage('◊î◊¢◊ì◊§◊ï◊™ ◊†◊©◊û◊®◊ï ◊ë◊î◊¶◊ú◊ó◊î!');
        setTimeout(() => setSaveMessage(''), 3000);
      } else {
        const errorText = await response.text();
        console.log('‚ùå ◊©◊í◊ô◊ê◊î ◊ë◊©◊û◊ô◊®◊î:', errorText);
        setSaveMessage(`◊©◊í◊ô◊ê◊î ◊ë◊©◊û◊ô◊®◊™ ◊î◊î◊¢◊ì◊§◊ï◊™: ${response.status}`);
      }
    } catch (error) {
      console.error('üí• ◊©◊í◊ô◊ê◊î ◊ë◊©◊û◊ô◊®◊™ ◊î◊¢◊ì◊§◊ï◊™:', error);
      setSaveMessage(`◊©◊í◊ô◊ê◊î ◊ë◊©◊û◊ô◊®◊™ ◊î◊î◊¢◊ì◊§◊ï◊™: ${error.message}`);
    } finally {
      setIsSaving(false);
      console.log('=== ◊°◊ô◊ï◊ù ◊©◊û◊ô◊®◊™ ◊î◊¢◊ì◊§◊ï◊™ ===');
    }
  };

  useEffect(() => {
    console.log('=== EditUser ◊†◊ò◊¢◊ü ===');
    console.log('üë§ ◊û◊©◊™◊û◊© ◊†◊ï◊õ◊ó◊ô:', currentUser);

    if (currentUser && currentUser.id) {
      console.log('üîÑ ◊û◊™◊ó◊ô◊ú ◊ò◊¢◊ô◊†◊™ ◊î◊¢◊ì◊§◊ï◊™...');
      loadUserPreferences();
    } else {
      console.log('‚ùå ◊ê◊ô◊ü ◊û◊©◊™◊û◊© ◊†◊ï◊õ◊ó◊ô');
    }
  }, [currentUser]);

  const changeToSimple = () => {
    setPreferenceMode('simple');
  };

  const changeToRanked = () => {
    setPreferenceMode('ranked');
  };

  const isSimpleActive = () => {
    return preferenceMode === 'simple' ? 'mode-button active' : 'mode-button';
  };

  const isRankedActive = () => {
    return preferenceMode === 'ranked' ? 'mode-button active' : 'mode-button';
  };

  const toggleSport = (sportId) => {
    const currentSelected = selectedSports.slice();
    const isCurrentlySelected = currentSelected.includes(sportId);

    if (isCurrentlySelected) {
      const newSelected = currentSelected.filter(id => id !== sportId);
      setSelectedSports(newSelected);
    } else {
      currentSelected.push(sportId);
      setSelectedSports(currentSelected);
    }
  };

  const moveSportUp = (sportId) => {
    const currentSelected = selectedSports.slice();
    const index = currentSelected.indexOf(sportId);

    if (index > 0) {
      const temp = currentSelected[index];
      currentSelected[index] = currentSelected[index - 1];
      currentSelected[index - 1] = temp;
      setSelectedSports(currentSelected);
    }
  };

  const moveSportDown = (sportId) => {
    const currentSelected = selectedSports.slice();
    const index = currentSelected.indexOf(sportId);

    if (index < currentSelected.length - 1) {
      const temp = currentSelected[index];
      currentSelected[index] = currentSelected[index + 1];
      currentSelected[index + 1] = temp;
      setSelectedSports(currentSelected);
    }
  };

  const getSportsByPreference = () => {
    const preferred = [];
    const others = [];

    SPORTS_LIST.forEach(sport => {
      const isSelected = selectedSports.includes(sport.id);
      if (isSelected) {
        preferred.push(sport);
      } else {
        others.push(sport);
      }
    });

    console.log('◊°◊§◊ï◊®◊ò ◊û◊ï◊¢◊ì◊§◊ô◊ù:', preferred.map(s => s.name));
    console.log('◊°◊§◊ï◊®◊ò ◊ê◊ó◊®◊ô◊ù:', others.map(s => s.name));

    return { preferred, others };
  };

  const getSortedPreferred = () => {
    const preferred = getSportsByPreference().preferred;

    if (preferenceMode === 'simple') {
      return preferred; 
    } else {
      return preferred.sort((a, b) => {
        const positionA = selectedSports.indexOf(a.id);
        const positionB = selectedSports.indexOf(b.id);
        return positionA - positionB;
      });
    }
  };

  const getRankingIcon = (rank) => {
    const icons = ['ü•á', 'ü•à', 'ü•â', '4Ô∏è‚É£', '5Ô∏è‚É£', '6Ô∏è‚É£', '7Ô∏è‚É£', '8Ô∏è‚É£', '9Ô∏è‚É£'];
    return icons[rank - 1] || `${rank}`;
  };

  const getIntensityLabel = (level) => {
    switch(level) {
      case 1: return '◊ß◊ú';
      case 2: return '◊ë◊ô◊†◊ï◊†◊ô';
      case 3: return '◊ß◊©◊î';
      default: return '◊ë◊ô◊†◊ï◊†◊ô';
    }
  };

  const getIntensityColor = (level) => {
    switch(level) {
      case 1: return '#4CAF50';
      case 2: return '#FF9800';
      case 3: return '#F44336';
      default: return '#FF9800';
    }
  };

  if (isLoading) {
    return (
      <div className="edit-user-container">
        <div className="content">
          <h2>◊ò◊ï◊¢◊ü ◊î◊¢◊ì◊§◊ï◊™...</h2>
        </div>
      </div>
    );
  }

  return (
    <div className="edit-user-container">
      <button className="back-button" onClick={onBackClick}>◊ó◊ñ◊®◊î</button>

      <div className="content">
        <h1>◊¢◊®◊ô◊õ◊™ ◊û◊©◊™◊û◊©</h1>
        <p>◊¢◊®◊ï◊ö ◊ê◊™ ◊î◊¢◊ì◊§◊ï◊™ ◊î◊°◊§◊ï◊®◊ò ◊ï◊î◊¢◊¶◊ô◊û◊ï◊™ ◊©◊ú◊ö</p>

        <div className="sports-section">
          <div className="preference-mode-selector">
            <button 
              className={isSimpleActive()}
              onClick={changeToSimple}
            >
              ◊ê◊†◊ô ◊ê◊ï◊î◊ë ◊î◊õ◊ú ◊ë◊ê◊ï◊™◊î ◊û◊ô◊ì◊î
            </button>

            <button 
              className={isRankedActive()}
              onClick={changeToRanked}
            >
              ◊î◊¢◊ì◊§◊î ◊û◊ì◊ï◊®◊í◊™
            </button>
          </div>

          {preferenceMode === 'ranked' && (
            <div className="ranking-instructions">
              <p>üìã ◊ú◊ó◊• ◊¢◊ú ◊î◊°◊§◊ï◊®◊ò ◊õ◊ì◊ô ◊ú◊î◊ï◊°◊ô◊£/◊ú◊î◊°◊ô◊® ◊û◊î◊®◊©◊ô◊û◊î</p>
              <p>‚¨ÜÔ∏è‚¨áÔ∏è ◊î◊©◊™◊û◊© ◊ë◊ó◊¶◊ô◊ù ◊õ◊ì◊ô ◊ú◊©◊†◊ï◊™ ◊ê◊™ ◊°◊ì◊® ◊î◊ì◊ô◊®◊ï◊í</p>
            </div>
          )}

          <div className="sports-container">
            <div className="sports-column">
              <h3>
                {preferenceMode === 'ranked' ? 'üèÜ ◊™◊ó◊ï◊û◊ô◊ù ◊û◊ì◊ï◊®◊í◊ô◊ù' : '◊™◊ó◊ï◊û◊ô◊ù ◊û◊ï◊¢◊ì◊§◊ô◊ù'}
              </h3>
              <div className="sports-list">
                {getSortedPreferred().map((sport, index) => { 
                  const rank = preferenceMode === 'ranked' ? index + 1 : null;
                  return (
                    <div key={sport.id} className="sport-item">
                      <button 
                        onClick={() => toggleSport(sport.id)}
                        className={preferenceMode === 'ranked' ? 'ranked-sport-button' : ''}
                      >
                        {preferenceMode === 'ranked' && (
                          <div className="ranking-display">
                            <span className="sport-icon">{sport.icon}</span>
                            <span className="sport-name">{sport.name}</span>
                          </div>
                        )}
                        {preferenceMode === 'simple' && (
                          <>
                            <span className="sport-icon">{sport.icon}</span>
                            <span className="sport-name">{sport.name}</span>
                          </>
                        )}
                      </button>
                      {preferenceMode === 'ranked' && (
                        <div className="ranking-controls">
                          <button 
                            className="rank-control-btn up-btn"
                            onClick={() => moveSportUp(sport.id)}
                            disabled={index === 0}
                          >
                            ‚¨ÜÔ∏è
                          </button>
                          <button 
                            className="rank-control-btn down-btn"
                            onClick={() => moveSportDown(sport.id)}
                            disabled={index === getSortedPreferred().length - 1}
                          >
                            ‚¨áÔ∏è
                          </button>
                        </div>
                      )}
                    </div>
                  );
                })}
              </div>
            </div>

            <div className="sports-column">
              <h3>◊©◊ê◊® ◊î◊ê◊ï◊§◊¶◊ô◊ï◊™</h3>
              <div className="sports-list">
                {getSportsByPreference().others.map(sport => (
                  <div key={sport.id} className="sport-item">
                    <button onClick={() => toggleSport(sport.id)}>
                      <span className="sport-icon">{sport.icon}</span>
                      <span className="sport-name">{sport.name}</span>
                    </button> 
                  </div>
                ))}
              </div>
            </div>
          </div>

          <div className="summary-section">
            <div className="intensity-section">
              <h4>üî• ◊®◊û◊™ ◊¢◊¶◊ô◊û◊ï◊™ ◊û◊ï◊¢◊ì◊§◊™:</h4>
              <div className="intensity-selector">
                {[1, 2, 3].map((level) => (
                  <button
                    key={level}
                    className={`intensity-btn ${intensityLevel === level ? 'active' : ''}`}
                    onClick={() => setIntensityLevel(level)}
                    style={{
                      backgroundColor: intensityLevel === level ? getIntensityColor(level) : 'rgba(255, 255, 255, 0.1)',
                      borderColor: getIntensityColor(level)
                    }}
                  >
                    <span className="intensity-number">{level}</span>
                    <span className="intensity-label">{getIntensityLabel(level)}</span>
                  </button>
                ))}
              </div>
            </div>

            {preferenceMode === 'ranked' && selectedSports.length > 0 && (
              <div className="ranking-summary">
                <h4>◊°◊ì◊® ◊î◊ì◊ô◊®◊ï◊í ◊©◊ú◊ö:</h4>
                <div className="ranking-list">
                  {getSortedPreferred().map((sport, index) => (
                    <div key={sport.id} className="ranking-item">
                      <span className="rank-badge">{getRankingIcon(index + 1)}</span>
                      <span className="sport-icon">{sport.icon}</span>
                      <span className="sport-name">{sport.name}</span>
                    </div>
                  ))}
                </div>
              </div>
            )}

            {saveMessage && (
              <div className="save-message" style={{
                color: saveMessage.includes('◊ë◊î◊¶◊ú◊ó◊î') ? '#4CAF50' : '#F44336',
                textAlign: 'center',
                marginTop: '20px',
                fontSize: '16px'
              }}>
                {saveMessage}
              </div>
            )}

            <div style={{ textAlign: 'center', marginTop: '30px' }}>
              <button 
                onClick={() => {
                  console.log('üîò ◊õ◊§◊™◊ï◊® ◊©◊û◊ô◊®◊î ◊†◊ú◊ó◊•!');
                  saveUserPreferences();
                }}
                disabled={isSaving}
                style={{
                  width: '250px',
                  height: '55px',
                  fontSize: '18px',
                  fontWeight: 'bold',
                  background: selectedSports.length > 0 ? 'linear-gradient(45deg, #b38ed8, #9c7dc4)' : 'rgba(255, 255, 255, 0.2)',
                  color: selectedSports.length > 0 ? '#ffffff' : 'rgba(255, 255, 255, 0.5)',
                  border: 'none',
                  borderRadius: '12px',
                  cursor: selectedSports.length > 0 && !isSaving ? 'pointer' : 'not-allowed',
                  transition: 'all 0.3s ease',
                  opacity: selectedSports.length > 0 && !isSaving ? 1 : 0.6
                }}
              >
                {isSaving ? '◊©◊ï◊û◊®...' : '◊©◊û◊ï◊® ◊ï◊î◊û◊©◊ö'}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default EditUser;
